import React, { Component } from "react";
import { Link } from "react-router-dom";


class Paginator extends Component {

  render() {

    var paginatorId = this.props.paginatorId;
    var pageCount = parseInt(this.props.pageCount);
    var pageStartIdx = parseInt(this.props.pageStartIdx);
    var pageEndIdx = parseInt(this.props.pageEndIdx);

    alert(pageStartIdx + ':' + pageEndIdx + ' --> ' + pageCount);


    var prevClass = (pageStartIdx === 1 ? "page-item disabled" : "page-item")
    var nextClass = (pageEndIdx === pageCount ? "page-item disabled" : "page-item")

    var liList = [];
    liList.push(
      <Link  id={"prev_page_"+paginatorId} className="page-link" to="#" aria-label="Previous" onClick={this.props.onClick}>
      <li  className={prevClass} >
        <span id={"spanone_prev_page_"+paginatorId} aria-hidden="true">&laquo;</span>
        <span id={"spantwo_prev_page_"+paginatorId} className="sr-only">Previous</span>  
      </li></Link>
      );
    for (var i=pageStartIdx; i <= pageEndIdx; i ++){
      liList.push(
        <Link id={"link_page_"+i+"_"+paginatorId} className="page-link" to="#" onClick={this.props.onClick}>
        <li  id={"li_page_"+i+"_"+paginatorId} className="page-item" >

          {i}
        </li></Link>);
    }

    liList.push(
      <Link id={"link_next_page_"+paginatorId} className="page-link" to="#" aria-label="Next" onClick={this.props.onClick}>
      <li id={"li_next_page_"+paginatorId}  className={nextClass} >
      <span id={"spanone_next_page_"+paginatorId}   aria-hidden="true">&raquo;</span>
      <span id={"spantwo_next_page_"+paginatorId}   className="sr-only">Next</span>

    </li></Link>);

    return (
      <nav aria-label="Page navigation example" 
      style={{height:"40px", border:"0px dashed red"}}>
      <ul class="pagination justify-content-end"
        style={{border:"0px dashed red"}}>
        {liList}
      </ul>
    </nav>
  );


  }
}

export default Paginator;
